package qfpay.wxshop.data.beans;import java.io.Serializable;public class CommonJsonBean implements Serializable {		private static final long serialVersionUID = 1L;				private String resperr = "";		private String respcd = "";		private String respmsg = "";				public String getResperr() {			return resperr;		}		public void setResperr(String resperr) {			this.resperr = resperr;		}		public String getRespcd() {			return respcd;		}		public void setRespcd(String respcd) {			this.respcd = respcd;		}		public String getRespmsg() {			return respmsg;		}		public void setRespmsg(String respmsg) {			this.respmsg = respmsg;		}}